import { Pie } from 'react-chartjs-2';
import { Line } from 'react-chartjs-2';
import { Chart as ChartJS } from 'chart.js/auto'




function Chart (){

    let dataset=[{
        data:[10,20,30],
        backgroundColor:[
            'red',
            'blue',
            'yellow'
        ]
    }]

    return (
        <div>
            <Line
            datasetIdKey='id'
            data={{
                labels: ['Jun', 'Jul', 'Aug'],
                datasets: [
                {
                    id: 1,
                    label: '',
                    data: [5, 6, 7],
                },
                {
                    id: 2,
                    label: '',
                    data: [3, 2, 1],
                },
                ],
            }}
            />
            <Chart 
                type = 'pie'
                data={{
                    labels: ['Jun', 'Jul', 'Aug'],
                    datasets: [{
                        data:[10,20,30],
                        backgroundColor:[
                            'red',
                            'blue',
                            'yellow'
                        ]
                    }]
                }} />
        </div>
    )
}

export default Chart;
